import React from "react";
import HeaderTailwind from "./header";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import App from "../App";
import ListTailwind from "./list";
import Search from "./search";
import initialDetails from "../data/initialDetails";
import SearchScreen from "./SearchScreen";

// This site has 3 pages, all of which are rendered
// dynamically in the browser (not server rendered).
//
// Although the page does not ever refresh, notice how
// React Router keeps the URL up to date as you navigate
// through the site. This preserves the browser history,
// making sure things like the back button and bookmarks
// work properly.

export default function RouteNav() {
  return (
    <div className="h-screen w-screen">
      <Link to="/">Home </Link>
      <Link to="/events">Events </Link>
      <Link to="/SearchScreen">Search </Link>
      <Switch>
        <Route exact path="/" component={Home}></Route>
        <Route exact path="/events" component={App}></Route>
        <Route path="/search" component={Search} />
        <Route path="/SearchScreen" component={SearchScreen} />
        <Route exact component={NotFound} />
      </Switch>
    </div>
  );
}
function Home() {
  return (
    <div className="h-screen w-screen">
      <HeaderTailwind></HeaderTailwind>

      <div>
        <h3 className={"font-extrabold font-serif"}>
          Welcome to CALENDAR APPLICATION
        </h3>
        <p>What are you waiting for? Schedule your upcoming events.</p>
        <h2>Continue</h2>
      </div>
    </div>
  );
}

function NotFound() {
  return (
    <div className="h-screen w-screen">
      <h2>Error 404</h2>
    </div>
  );
}
